  false,\n\t\"url\": null,\n\t\"notes\": \"Orthorectified color infrared ERDAS Imagine
  image of Richmond National Battlefield Park. Produced from 109 color infrared photos
  taken October 23, 2001. Orthorectification accomplished with Imagine Orthobase v8.6
  software. Horizontal RMSE is 1.098 meters. This meets class 1 NMAS for 1:6000 scale
  photography. Richmond National Battlefield Park is broken into 6 pieces due to space
  constraints. The 6 individual pieces are listed as follows: beaverdam_chick_fall.img,
  cold_garth_newgain_fall.img, fort_darling_fall.img, fort_harrison_fall.img, malvern_glendale_fall.img,
  parkers_bat_fall.img\",\n\t\"license_title\": null,\n\t\"extras\": [{\n\t\t\"key\":
